INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (1, 1, '此时的胎宝宝还处在真正的史前状态，以精子、卵子的形态存在。', '精子和卵子的质量，与准爸准妈的身体状况息息相关，所以在备孕前就应该养成良好的生活习惯哦。', '可能会感受到兴奋和好奇，同时也可能感到焦虑和不安，因为怀孕刚刚开始，充满了不确定性。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (2, 2, '你可能在一周的末期排出成熟的卵子，一旦和精子相遇，你就成为准妈妈了。', '排卵期中，你可能出现心情低落、脾气暴躁等症状，你要放轻松，愉快心情有利卵子与精子的相遇结合。', '可能会感受到兴奋和好奇，同时也可能感到焦虑和不安，因为怀孕刚刚开始，充满了不确定性。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (3, 3, '这时精子和卵子已经结合在一起形成受精卵，受精卵有0.1cm长，体重非常轻。', '这时你已经怀孕了!这个时期你自身可能还没有什么感觉，但在你的身体内却在进行着一场变革。', '可能会感受到兴奋和好奇，同时也可能感到焦虑和不安，因为怀孕刚刚开始，充满了不确定性。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (4, 4, '进入孕4周，受精卵不断地分裂，其中一部分形成大脑，其余形成神经组织。这时胚胎大约长达0.2cm。', '本周受精卵刚刚着床，虽然准妈妈的体内正在经历着巨变，但怀孕的征兆并不明显。你可能会有轻微的不舒服，出现类似“感冒”的症状，有时会感到疲劳。', '可能会感受到兴奋和好奇，同时也可能感到焦虑和不安，因为怀孕刚刚开始，充满了不确定性。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (5, 5, '此时，小胚胎大约长0.4cm，有苹果籽那么大，外观很像个“小海马”。\n细胞正在分化形成胎儿的主要器官(如肾脏、肝脏)，神经管也开始发育。在这一周，宝宝的小心脏已经开始分成心室，开始跳动，并能泵血了。与此同时，为胎儿输送营养和氧气的最初形态的胎盘和脐带已经开始工作了。', '此时，你可能会出现妊娠反应，如恶心、孕吐、乳房胀痛、乳晕着色、疲劳以及尿频等症状。此时的你情绪多变;嗅觉灵敏，讨厌烟酒等其他饮料;会感到全身乏力劳累。', '孕妇可能会开始感受到怀孕的真实性，并且对即将到来的变化和挑战感到更加现实。有些人可能会经历情绪波动，包括情绪低落和焦虑。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (6, 6, '此时，胎儿长到约0.6cm，胎重约3g，看起来就像颗小松籽仁。\n\n在本周开始，胎儿的头部、脑泡、额面器官、呼吸、消化、神经等器官开始分化。他的心脏开始有规律地跳动。从B超可以清晰看见胎囊。', '你的妊娠反应开始明显起来，在白天也感到昏昏欲睡。现在最好不要外出旅行，过累可能引起流产。\n\n妊娠以后，大约从第6周开始，准妈妈会开始出现孕吐，在8周左右达到高峰，10周以后逐渐缓解。', '孕妇可能会开始感受到怀孕的真实性，并且对即将到来的变化和挑战感到更加现实。有些人可能会经历情绪波动，包括情绪低落和焦虑。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (7, 7, '此时胚胎的大小就像一颗豆子，长约1cm。现在胚胎的细胞仍在快速地分裂，心脏开始划分成左心房和右心室，他仍有一个尾巴。', '现在你随时可能有饥饿的感觉，你的体态很快就会改变，但不要过多地考虑体形，因为目前这几周是胎儿发展的关键时期，更应注意营养。', '孕妇可能会开始感受到怀孕的真实性，并且对即将到来的变化和挑战感到更加现实。有些人可能会经历情绪波动，包括情绪低落和焦虑。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (8, 8, '胎儿现在约为1.2cm，胎重约6g。此时胎形已定，可以分出胎头、体及四肢，胎头大于躯干。B超可见胎囊约占宫腔1/2，胎儿形态及胎动清楚可见，并可看见卵黄囊。', '较上周相比，你的体型和体重并没有明显的变化，从外观上来看，你还并不像一个孕妇。不过实际上，你的子宫差不多已经有一个拳头大了，长短5厘米左右。', '孕妇可能会开始感受到怀孕的真实性，并且对即将到来的变化和挑战感到更加现实。有些人可能会经历情绪波动，包括情绪低落和焦虑。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (9, 9, '从这个月开始，胚胎正式可以叫做“胎儿”了，他长约2cm，在胚胎期的小尾巴已经不见了，所有的器官、肌肉、神经开始工作。', '现在你的体型变化不大，不过胸部将继续胀大，乳晕和乳头颜色更暗，但体型仍变化不大，现在你需要使用新的乳罩了。', '随着怀孕进入第二个月，一些孕妇可能会感受到更多的能量和舒适感，但也可能会经历身体和情绪上的变化。对于一些人来说，这一时期可能是对怀孕的接受和调整的时期。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (10, 10, '胎儿的身长大约有4cm，体重达到13g左右，身体所有的部分都已经初具规模。', '你的身体开始变形了，体重快速增加，腰更粗了，胸更大了。乳头上可能会长出白色的小微粒，这些微粒内含有白色的润滑剂，提早为母乳喂养做好准备。', '随着怀孕进入第二个月，一些孕妇可能会感受到更多的能量和舒适感，但也可能会经历身体和情绪上的变化。对于一些人来说，这一时期可能是对怀孕的接受和调整的时期。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (11, 11, '此时的胎宝宝胎长6cm，体重约19g，大概有你的食指那么长。', '你的子宫现在看起来像个柚子，你可能会发现在腹部有一条深色的竖线，这是妊娠线。', '随着怀孕进入第二个月，一些孕妇可能会感受到更多的能量和舒适感，但也可能会经历身体和情绪上的变化。对于一些人来说，这一时期可能是对怀孕的接受和调整的时期。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (12, 12, '胎长9cm，胎重23g，在本周胎儿维持生命器官已经开始工作，胎儿维持生命的器官已经开始工作，如肝脏开始分泌胆汁，已形成完整的肺，肝脏开始制造血细胞，肾脏分泌尿液到膀胱。胎儿身体的姿势变得更直了。', '你会明显感觉的腰变粗了，内衣的尺寸也要比平常大一号，开始更像一位孕妈妈了。', '随着怀孕进入第二个月，一些孕妇可能会感受到更多的能量和舒适感，但也可能会经历身体和情绪上的变化。对于一些人来说，这一时期可能是对怀孕的接受和调整的时期。', '定期进行产前检查，确保孕妇和胎儿的健康。\n饮食上要注意摄入足够的营养，包括叶酸、铁和钙。\n避免接触有害物质，如烟草、酒精和有毒化学物质。\n保持适当的运动和活动，避免过度劳累。', '增加叶酸的摄入量，有助于预防神经管缺陷。叶酸丰富的食物包括绿叶蔬菜、豆类、坚果和谷物。\n增加铁的摄入量，以防止贫血。铁丰富的食物包括红肉、禽类、鱼类、豆类、坚果和谷物。\n食用富含钙的食物，有助于胎儿骨骼和牙齿的发育。钙丰富的食物包括奶制品、豆类、坚果和绿叶蔬菜。', NULL, '陪伴孕妻进行产前检查，了解胎儿的发育情况。\n帮助孕妻调整饮食习惯，确保摄入足够的营养。\n提供情感支持和理解，帮助孕妻缓解孕吐、疲劳和情绪波动等不适。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (13, 13, '此时胎长10cm，胎重约25g。此时他的脸部特征非常明显，看上去更像成人了。', '你的腹部开始隆起，体型变化大的你，不久就需要穿孕妇装了。有些孕妈妈在腹部、腰部会出现妊娠纹。', '孕妇可能会感受到怀孕的肯定和自信，因为胎儿开始显着增长，并且通常能够通过体型的变化和胎动来感受到孕妇的存在。', '继续定期进行产前检查，并按医生建议进行补充和治疗。\n保持良好的姿势和体重控制，避免过度压力和劳累。\n培养良好的睡眠习惯，保持充足的睡眠时间。\n寻求社交支持和交流，与家人和朋友分享喜悦和担忧。', '保持均衡的饮食，确保摄入足够的营养，包括蛋白质、碳水化合物、脂肪、维生素和矿物质。\n食用富含纤维的食物，有助于缓解便秘问题。纤维丰富的食物包括水果、蔬菜、全谷物和豆类。', NULL, '协助孕妻进行孕期体检和产前筛查，关注孕妻和胎儿的健康状况。\n参与准父母课程和产前教育，了解分娩过程和产后护理知识。\n维护家庭和工作的平衡，减轻孕妻的负担，给予家庭的支持和帮助。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (14, 14, '此时胎长12cm，胎重28g。他现在还没有你的手掌大，但是五官已经清晰了。', '你这时恶心、疲劳症状会减轻，体内的雌性激素使你的头发乌黑发亮。', '孕妇可能会感受到怀孕的肯定和自信，因为胎儿开始显着增长，并且通常能够通过体型的变化和胎动来感受到孕妇的存在。', '继续定期进行产前检查，并按医生建议进行补充和治疗。\n保持良好的姿势和体重控制，避免过度压力和劳累。\n培养良好的睡眠习惯，保持充足的睡眠时间。\n寻求社交支持和交流，与家人和朋友分享喜悦和担忧。', '保持均衡的饮食，确保摄入足够的营养，包括蛋白质、碳水化合物、脂肪、维生素和矿物质。\n食用富含纤维的食物，有助于缓解便秘问题。纤维丰富的食物包括水果、蔬菜、全谷物和豆类。', NULL, '协助孕妻进行孕期体检和产前筛查，关注孕妻和胎儿的健康状况。\n参与准父母课程和产前教育，了解分娩过程和产后护理知识。\n维护家庭和工作的平衡，减轻孕妻的负担，给予家庭的支持和帮助。');
