INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (18, 18, '胎长20cm，胎重200g，他和一个苹果那么重。', '随着你的腹部逐渐增大，身体重心发生改变，你可能偶尔会感觉脚下不稳。', '这一时期可能是怀孕的中期，孕妇可能会感受到身体上的舒适和情绪上的稳定。他们可能会开始享受怀孕的过程，并且对未来的角色转变感到兴奋和期待。', '继续定期进行产前检查，并按医生建议进行补充和治疗。\n保持良好的姿势和体重控制，避免过度压力和劳累。\n培养良好的睡眠习惯，保持充足的睡眠时间。\n寻求社交支持和交流，与家人和朋友分享喜悦和担忧。', '保持均衡的饮食，确保摄入足够的营养，包括蛋白质、碳水化合物、脂肪、维生素和矿物质。\n食用富含纤维的食物，有助于缓解便秘问题。纤维丰富的食物包括水果、蔬菜、全谷物和豆类。', NULL, '协助孕妻进行孕期体检和产前筛查，关注孕妻和胎儿的健康状况。\n参与准父母课程和产前教育，了解分娩过程和产后护理知识。\n维护家庭和工作的平衡，减轻孕妻的负担，给予家庭的支持和帮助。');
