INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (22, 22, '胎长约27cm，胎重450g。这时胎儿可以听到你的声音，眉毛和眼睑已清晰可辨，小手指已长出娇嫩指甲。', '你的身体会越来越重，由于子宫日益增高压迫肺，你可能在上楼的时候会感到呼吸有点儿困难。', '随着孕期的进展，孕妇可能会开始考虑分娩和育儿的细节，并且对未来的变化和挑战可能会感到焦虑和不安。', '继续定期进行产前检查，并按医生建议进行补充和治疗。\n保持良好的姿势和体重控制，避免过度压力和劳累。\n培养良好的睡眠习惯，保持充足的睡眠时间。\n寻求社交支持和交流，与家人和朋友分享喜悦和担忧。', '保持均衡的饮食，确保摄入足够的营养，包括蛋白质、碳水化合物、脂肪、维生素和矿物质。\n食用富含纤维的食物，有助于缓解便秘问题。纤维丰富的食物包括水果、蔬菜、全谷物和豆类。', NULL, '协助孕妻进行孕期体检和产前筛查，关注孕妻和胎儿的健康状况。\n参与准父母课程和产前教育，了解分娩过程和产后护理知识。\n维护家庭和工作的平衡，减轻孕妻的负担，给予家庭的支持和帮助。');
