INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (24, 24, '胎长30cm，胎重630g。现在宝宝看起来比较瘦，过段时间就胖起来了呢!', '准妈的宫高约24cm，随着体重的增加，可能你还会发现原来凹进去的肚脐变得向外突出。', '随着孕期的进展，孕妇可能会开始考虑分娩和育儿的细节，并且对未来的变化和挑战可能会感到焦虑和不安。', '继续定期进行产前检查，并按医生建议进行补充和治疗。\n保持良好的姿势和体重控制，避免过度压力和劳累。\n培养良好的睡眠习惯，保持充足的睡眠时间。\n寻求社交支持和交流，与家人和朋友分享喜悦和担忧。', '保持均衡的饮食，确保摄入足够的营养，包括蛋白质、碳水化合物、脂肪、维生素和矿物质。\n食用富含纤维的食物，有助于缓解便秘问题。纤维丰富的食物包括水果、蔬菜、全谷物和豆类。', NULL, '协助孕妻进行孕期体检和产前筛查，关注孕妻和胎儿的健康状况。\n参与准父母课程和产前教育，了解分娩过程和产后护理知识。\n维护家庭和工作的平衡，减轻孕妻的负担，给予家庭的支持和帮助。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (25, 25, '胎长：31cm，胎重：750g，他第一次睁开了眼睛，会对光亮做出反应哦。', '胎儿越来越大，你会觉得更加疲倦，腰腿痛也更明显，肚子上、乳房上会出现一些暗红色的妊娠纹。', '孕妇可能会开始准备分娩和育儿，包括参加分娩准备课程和准备产前计划。他们可能会感受到身体上的不适和疲劳，但同时也会感受到对即将到来的宝宝的期待和兴奋。', '继续定期进行产前检查，并按医生建议进行补充和治疗。\n保持良好的姿势和体重控制，避免过度压力和劳累。\n培养良好的睡眠习惯，保持充足的睡眠时间。\n寻求社交支持和交流，与家人和朋友分享喜悦和担忧。', '保持均衡的饮食，确保摄入足够的营养，包括蛋白质、碳水化合物、脂肪、维生素和矿物质。\n食用富含纤维的食物，有助于缓解便秘问题。纤维丰富的食物包括水果、蔬菜、全谷物和豆类。', NULL, '协助孕妻进行孕期体检和产前筛查，关注孕妻和胎儿的健康状况。\n参与准父母课程和产前教育，了解分娩过程和产后护理知识。\n维护家庭和工作的平衡，减轻孕妻的负担，给予家庭的支持和帮助。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (26, 26, '胎长32.5cm，胎重：950g，胎宝的听力系统现在已经完全形成了，他将对声音越来越敏感。', '现在你子宫高度大约在肚脐上6cm的位置，孕期荷尔蒙起作用了，它会松弛你的关节和韧带为分娩作准备。', '孕妇可能会开始准备分娩和育儿，包括参加分娩准备课程和准备产前计划。他们可能会感受到身体上的不适和疲劳，但同时也会感受到对即将到来的宝宝的期待和兴奋。', '继续定期进行产前检查，并按医生建议进行补充和治疗。\n保持良好的姿势和体重控制，避免过度压力和劳累。\n培养良好的睡眠习惯，保持充足的睡眠时间。\n寻求社交支持和交流，与家人和朋友分享喜悦和担忧。', '保持均衡的饮食，确保摄入足够的营养，包括蛋白质、碳水化合物、脂肪、维生素和矿物质。\n食用富含纤维的食物，有助于缓解便秘问题。纤维丰富的食物包括水果、蔬菜、全谷物和豆类。', NULL, '协助孕妻进行孕期体检和产前筛查，关注孕妻和胎儿的健康状况。\n参与准父母课程和产前教育，了解分娩过程和产后护理知识。\n维护家庭和工作的平衡，减轻孕妻的负担，给予家庭的支持和帮助。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (27, 27, '胎长34cm，胎重1000g。他现在可以称的上是个小运动健将了，平均一小时要动50次。', '你的子宫约在肚脐7cm处，宫高约27cm。你的子宫接近肋缘，所以你会经常觉得气短。', '孕妇可能会开始准备分娩和育儿，包括参加分娩准备课程和准备产前计划。他们可能会感受到身体上的不适和疲劳，但同时也会感受到对即将到来的宝宝的期待和兴奋。', '保持良好的营养和饮食习惯，确保胎儿和孕妇的健康。\n注意体重控制，避免过度肥胖或营养不良。\n定期进行分娩准备课程和产前训练，了解分娩过程和产后护理。\n准备分娩包和医院用品，包括孕妇衣物、产妇用品和宝宝用品。', '控制碳水化合物的摄入量，以避免过度体重增加和胎儿过大。\n增加蛋白质的摄入量，以支持胎儿的生长和发育。蛋白质丰富的食物包括肉类、鱼类、禽类、豆类和奶制品。\n食用易消化的食物，避免过度油腻和刺激性食物，以减轻消化不适和胃灼热的症状。', NULL, '准备分娩包和医院用品，确保一切准备就绪。\n学习分娩的应急处理方法，为可能的分娩做好准备。\n给予孕妻情感支持和鼓励，帮助她度过分娩前的紧张和焦虑。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (28, 28, '胎长35cm，胎重1150g，几乎快占满整个子宫了。', '你的腹部向前挺得更为厉害，身体重心移到腹部下方，只要稍微失去平衡，就会感到腰酸背痛或腿痛。', '孕妇可能会开始准备分娩和育儿，包括参加分娩准备课程和准备产前计划。他们可能会感受到身体上的不适和疲劳，但同时也会感受到对即将到来的宝宝的期待和兴奋。', '保持良好的营养和饮食习惯，确保胎儿和孕妇的健康。\n注意体重控制，避免过度肥胖或营养不良。\n定期进行分娩准备课程和产前训练，了解分娩过程和产后护理。\n准备分娩包和医院用品，包括孕妇衣物、产妇用品和宝宝用品。', '控制碳水化合物的摄入量，以避免过度体重增加和胎儿过大。\n增加蛋白质的摄入量，以支持胎儿的生长和发育。蛋白质丰富的食物包括肉类、鱼类、禽类、豆类和奶制品。\n食用易消化的食物，避免过度油腻和刺激性食物，以减轻消化不适和胃灼热的症状。', NULL, '准备分娩包和医院用品，确保一切准备就绪。\n学习分娩的应急处理方法，为可能的分娩做好准备。\n给予孕妻情感支持和鼓励，帮助她度过分娩前的紧张和焦虑。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (29, 29, '胎长36cm，胎重1300g。和过去相比，宝宝看上去胖了不少，因为皮下脂肪开始生长。', '宫高约29cm，你可能会遭遇鼻子通气不顺或鼻出血的情况，分娩后会自动消失，不要担心。', '孕妇可能会感受到孕期的疲劳和不适加重，但同时也会感受到对即将到来的宝宝的爱和关怀。对分娩和育儿的焦虑可能会增加，但同时也会感受到准备的成就感。', '保持良好的营养和饮食习惯，确保胎儿和孕妇的健康。\n注意体重控制，避免过度肥胖或营养不良。\n定期进行分娩准备课程和产前训练，了解分娩过程和产后护理。\n准备分娩包和医院用品，包括孕妇衣物、产妇用品和宝宝用品。', '控制碳水化合物的摄入量，以避免过度体重增加和胎儿过大。\n增加蛋白质的摄入量，以支持胎儿的生长和发育。蛋白质丰富的食物包括肉类、鱼类、禽类、豆类和奶制品。\n食用易消化的食物，避免过度油腻和刺激性食物，以减轻消化不适和胃灼热的症状。', NULL, '准备分娩包和医院用品，确保一切准备就绪。\n学习分娩的应急处理方法，为可能的分娩做好准备。\n给予孕妻情感支持和鼓励，帮助她度过分娩前的紧张和焦虑。');
