INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (37, 37, '胎重3000g左右，胎长46cm左右，现在胎宝宝正在练习呼吸。', '这一周你会感觉宫缩比上周更加频繁了，而且小腹的坠胀感也很强。', '孕妇可能会感受到分娩的即将到来，同时也可能会感受到焦虑和不安。对分娩的恐惧和对宝宝的期待可能会交织在一起，但同时也会感受到对未来的乐观和希望。', '保持良好的营养和饮食习惯，确保胎儿和孕妇的健康。\n注意体重控制，避免过度肥胖或营养不良。\n定期进行分娩准备课程和产前训练，了解分娩过程和产后护理。\n准备分娩包和医院用品，包括孕妇衣物、产妇用品和宝宝用品。', '控制碳水化合物的摄入量，以避免过度体重增加和胎儿过大。\n增加蛋白质的摄入量，以支持胎儿的生长和发育。蛋白质丰富的食物包括肉类、鱼类、禽类、豆类和奶制品。\n食用易消化的食物，避免过度油腻和刺激性食物，以减轻消化不适和胃灼热的症状。', NULL, '准备分娩包和医院用品，确保一切准备就绪。\n学习分娩的应急处理方法，为可能的分娩做好准备。\n给予孕妻情感支持和鼓励，帮助她度过分娩前的紧张和焦虑。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (38, 38, '胎长约47.5cm，胎重约3100g。胎儿的头在你的骨盆腔内摇摆，周围有骨盆的骨架保护，很安全。', '现在你的体重仍然以每周大概450g在增加，你的手脚看起来还非常肿，等分娩过后水肿就会消失的。', '孕妇可能会感受到分娩的即将到来，同时也可能会感受到焦虑和不安。对分娩的恐惧和对宝宝的期待可能会交织在一起，但同时也会感受到对未来的乐观和希望。', '保持良好的营养和饮食习惯，确保胎儿和孕妇的健康。\n注意体重控制，避免过度肥胖或营养不良。\n定期进行分娩准备课程和产前训练，了解分娩过程和产后护理。\n准备分娩包和医院用品，包括孕妇衣物、产妇用品和宝宝用品。', '控制碳水化合物的摄入量，以避免过度体重增加和胎儿过大。\n增加蛋白质的摄入量，以支持胎儿的生长和发育。蛋白质丰富的食物包括肉类、鱼类、禽类、豆类和奶制品。\n食用易消化的食物，避免过度油腻和刺激性食物，以减轻消化不适和胃灼热的症状。', NULL, '准备分娩包和医院用品，确保一切准备就绪。\n学习分娩的应急处理方法，为可能的分娩做好准备。\n给予孕妻情感支持和鼓励，帮助她度过分娩前的紧张和焦虑。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (39, 39, '胎重约3300g，胎长约49cm。胎宝宝现在还在继续增加脂肪，他的发育已经成熟了。', '现在你的肚子看起来巨大无比，行动更加不方便了。', '孕妇可能会感受到分娩的即将到来，同时也可能会感受到焦虑和不安。对分娩的恐惧和对宝宝的期待可能会交织在一起，但同时也会感受到对未来的乐观和希望。', '保持良好的营养和饮食习惯，确保胎儿和孕妇的健康。\n注意体重控制，避免过度肥胖或营养不良。\n定期进行分娩准备课程和产前训练，了解分娩过程和产后护理。\n准备分娩包和医院用品，包括孕妇衣物、产妇用品和宝宝用品。', '控制碳水化合物的摄入量，以避免过度体重增加和胎儿过大。\n增加蛋白质的摄入量，以支持胎儿的生长和发育。蛋白质丰富的食物包括肉类、鱼类、禽类、豆类和奶制品。\n食用易消化的食物，避免过度油腻和刺激性食物，以减轻消化不适和胃灼热的症状。', NULL, '准备分娩包和医院用品，确保一切准备就绪。\n学习分娩的应急处理方法，为可能的分娩做好准备。\n给予孕妻情感支持和鼓励，帮助她度过分娩前的紧张和焦虑。');
INSERT INTO `bp_pregnancy_week` (`id`, `week`, `fetal_change`, `maternal_change`, `psychological_change`, `care_tip`, `dietary_advice`, `common_question`, `remark`) VALUES (40, 40, '胎长50cm，胎重3500g，这时的宝宝像一个滚圆的西瓜，随时可能“瓜熟蒂落”哦!', '也许在本周的某一天，你会觉得肚子像针扎一样痛，那就是宫缩。如果宫缩间隔小于30分钟，赶紧去医院准备生产吧。', '孕妇可能会感受到分娩的即将到来，同时也可能会感受到焦虑和不安。对分娩的恐惧和对宝宝的期待可能会交织在一起，但同时也会感受到对未来的乐观和希望。', '保持良好的营养和饮食习惯，确保胎儿和孕妇的健康。\n注意体重控制，避免过度肥胖或营养不良。\n定期进行分娩准备课程和产前训练，了解分娩过程和产后护理。\n准备分娩包和医院用品，包括孕妇衣物、产妇用品和宝宝用品。', '控制碳水化合物的摄入量，以避免过度体重增加和胎儿过大。\n增加蛋白质的摄入量，以支持胎儿的生长和发育。蛋白质丰富的食物包括肉类、鱼类、禽类、豆类和奶制品。\n食用易消化的食物，避免过度油腻和刺激性食物，以减轻消化不适和胃灼热的症状。', NULL, '准备分娩包和医院用品，确保一切准备就绪。\n学习分娩的应急处理方法，为可能的分娩做好准备。\n给予孕妻情感支持和鼓励，帮助她度过分娩前的紧张和焦虑。');
